script:
reset();

const size = 96;
const maxTerrainHeight = 32;
const maxHeight = 80;
const origin = { x: size * -0.5, z: size * -0.5 };
// const seed = Math.floor(Math.random() * (2 ** 32));
// console.log(`seed: ${seed}`);
const seed = 897580047;
const simplex = new SimplexNoise(seed);

const tower = {
  origin: {
    x: -1,
    y: 0,
    z: -1,
  },
  height: maxHeight - 16,
  radius: 11,
};

const map = new Uint8Array(size * maxHeight * size);

const trunk = 3;
const leaves = 2;
const voxelNeighbors = [
  { x: 1, y: 0, z: 0 },
  { x: -1, y: 0, z: 0 },
  { x: 0, y: 0, z: 1 },
  { x: 0, y: 0, z: -1 },
  { x: 0, y: 1, z: 0 },
  { x: 0, y: -1, z: 0 },
];
const tree = (
  position,
  height,
  radius
) => {
  const branches = height + radius * 0.5;
  const queue = [position];
  while (queue.length) {
    const {
      x,
      y,
      z,
      distance = 0,
    } = queue.shift();
    if (y < 0 || y >= maxHeight) {
      return;
    }
    const isTrunk = distance < height;
    map[x * size * maxHeight + y * size + z] = 2;
    update(origin.x + x, y, origin.z + z, (isTrunk || distance < branches) ? trunk : leaves);
    const pushNeighbor = (offset) => {
      const nx = x + offset.x;
      const ny = y + offset.y;
      const nz = z + offset.z;
      if (
        nx >= 0 && nx < size
        && nz >= 0 && nz < size
        && !map[nx * size * maxHeight + ny * size + nz]
      ) {
        queue.push({
          x: nx,
          y: ny,
          z: nz,
          distance: distance + 1,
        });
        return true;
      }
      return false;
    };
    if (isTrunk) {
      pushNeighbor({ x: 0, y: 1, z: 0 });
    } else if (distance === height) {
      voxelNeighbors.forEach((offset) => {
        if (offset.y !== -1) {
          pushNeighbor(offset);
        }
      });
    } else if (distance < (height + radius)) {
      let count = 0;
      const neighbors = voxelNeighbors.length;
      for (let i = 0; i < neighbors; i += 1) {
        const neighbor = voxelNeighbors[
          Math.floor(
            Math.abs(simplex.noise3D((x + i) * 2, (y - i) / 2, (z + i) * 2)) * neighbors
          )
        ];
        if (pushNeighbor(neighbor)) {
          count += 1;
          if (count >= 2) {
            break;
          }
        }
      }
    }
  }
};

const center = size * 0.5 - 0.5;
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxTerrainHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      if (
        Math.sqrt(
          ((origin.x + x) - tower.origin.x - 0.5) ** 2
          + ((origin.z + z) - tower.origin.z - 0.5) ** 2
        ) <= tower.radius
      ) {
        continue;
      }
      const sd = (center - x) ** 2 + (center - z) ** 2;
      const top = Math.min(size * Math.exp(
        -(sd) / ((size - 16) * 12)
      ), size * 0.5 - Math.sqrt(sd));
      const height = Math.floor(
       (
          Math.abs(simplex.noise3D(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(simplex.noise3D(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(simplex.noise3D(x / 128, y / 64, z / 128)) * 0.4
        ) * top
      );
      map[x * size * maxHeight + y * size + z] = y < height ? 1 : 0;
    }
  }
}

for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      if (map[x * size * maxHeight + y * size + z] === 1) {
        const top = (
          y === (maxHeight - 1)
          || !map[
            x * size * maxHeight + (y + 1) * size + z
          ]
        );
        const type = top ? 1 : 4;
        if (top && y > 2 && simplex.noise3D(x / 8, y / 4, z / 8) > 0.6) {
          if (simplex.noise3D(y / 8, x / 4, z / 8) > -0.5) {
            update(origin.x + x, y + 1, origin.z + z, 5);
          } else {
            const n = Math.abs(simplex.noise2D(z / 8, x / 8));
            const h = 5 + Math.floor(Math.abs(simplex.noise2D(x / 2, z / 2)) * 16);
            const r = 7 + Math.floor(n * h * 0.5);
            tree({x, y, z}, h, r);
          }
        }
        update(origin.x + x, y, origin.z + z, type);
      }
    }
  }
}

// top dome
sphere(
  tower.origin.x,
  tower.origin.y + tower.height,
  tower.origin.z,
  tower.radius * 1.8,
  (x, y, z) => (
    y >= (tower.origin.y + tower.height) ? (
     y >= (tower.origin.y + tower.height + 2) ? 6 : 7
   ) : 0
  )
);
sphere(
  tower.origin.x,
  tower.origin.y + tower.height,
  tower.origin.z,
  tower.radius * 1.4,
  0
);
cylinder(
  tower.origin.x - tower.radius * 2,
  tower.origin.y + tower.height,
  tower.origin.z,
  'x', 4, tower.radius * 4,
  0
);
cylinder(
  tower.origin.x,
  tower.origin.y + tower.height,
  tower.origin.z - tower.radius * 2,
  'z', 4, tower.radius * 4,
  0
);

// tower
cylinder(
  tower.origin.x, tower.origin.y, tower.origin.z,
  'y', tower.radius, tower.height, (x, y, z) => {
    const dx = (x - tower.origin.x - 0.5);
    const dz = (z - tower.origin.z - 0.5);
    return (
      y === 0
      || (
        (y < 6 || y % 16 <= 3 || (
          (Math.PI - Math.atan2(dx, dz) + Math.PI * 0.24) % (Math.PI * 0.5)
        ) < Math.PI * 0.2)
        && (
          Math.sqrt(
            dx ** 2 + dz ** 2
          ) >= tower.radius - 2
        )
      )
    ) ? 6 : 0;
  }
);

// top platform
box(
  tower.origin.x - 7,
  tower.origin.y + tower.height - 3,
  tower.origin.z - 7,
  16, 1, 16,
  6
);
box(
  tower.origin.x - 7,
  tower.origin.y + tower.height - 2,
  tower.origin.z - 7,
  16, 2, 16,
  7
);
box(
  tower.origin.x - 5,
  tower.origin.y + tower.height - 1,
  tower.origin.z - 5,
  12, 1, 12,
  0
);
box(
  tower.origin.x - 4,
  tower.origin.y + tower.height - 2,
  tower.origin.z - 4,
  10, 1, 10,
  0
);
box(
  tower.origin.x - 1,
  tower.origin.y + tower.height - 3,
  tower.origin.z - 1,
  4, 1, 4,
  0
);

box(
  tower.origin.x,
  tower.origin.y + tower.height - 2,
  tower.origin.z - 2,
  2, 2, 1,
  7
);
box(
  tower.origin.x,
  tower.origin.y + tower.height - 2,
  tower.origin.z + 3,
  2, 2, 1,
  7
);
box(
  tower.origin.x + 3,
  tower.origin.y + tower.height - 2,
  tower.origin.z,
  1, 2, 2,
  7
);
